import React from 'react';
import './BookDetails.scss';
import book1 from '../../images/book1.jpg';

const bookDetails = ({ books }) => (
  <div className="book-details">
    <div className="book-details__image-container">
      <img src={book1} alt="book cover" />
    </div>
    <div>
      <h3 className="book-details__title"> This is title of the book</h3>
      <span className="book-details__author">By suman shrestha</span>
      <span className="book-details__publication">Janta Publication</span>
      <span className="book-details__price">Rs 3000</span>
      <p className="book-details__description"> This is description for the project.</p>
    </div>
  </div>
);

export default bookDetails;
